const ConvertDataForLineChart = (dataArray) => {
    const lineChartData = [];

    dataArray.forEach((eventsArray) => {
        const formattedEvents = eventsArray.map((event) => {
            const eventType = event.EventType;
            const startTimestamp = new Date(event.Start);
            const endTimestamp = new Date(event.End);

            return {
                x: { start: startTimestamp, end: endTimestamp }, // Objeto contendo o início e o fim do evento
                y: eventType // Usar o tipo de evento como coordenada y
            };
        });

        // Adicionar os eventos formatados ao conjunto de dados para o gráfico de linhas
        lineChartData.push(formattedEvents);
    });

    return lineChartData;
};

export default ConvertDataForLineChart;
